import React from 'react'
import AddButton from './AddButton'
import Header from './Headers'

const ProductLayout = () => {
    
    const [isLoading,setLoading] =useState(true)

    return (
    <>
    <Header title="Products App"/>
    <AddButton/>
    {
    isLoading
    ? <Loading/>
    : 'mostrar resultado fetch'
    }
    </>
    )}

export default ProductLayout
